/*********************************************JQuery For Form Validation************************************/
(function ($) {
    "use strict";
	$('.validate-input .input100').each(function(){
        $(this).on('blur', function(){
            if(validate(this) == false){
                showValidate(this);
            }
            else {
                $(this).parent().addClass('true-validate');
            }
        })    
    })
	var input = $('.validate-input .input100');

    $('.validate-form .input100').each(function(){
        $(this).focus(function(){
           hideValidate(this);
           $(this).parent().removeClass('true-validate');
        });
    });

     function validate (input) {
        if($(input).attr('type') == 'email' || $(input).attr('name') == 'cust_email') {
            if($(input).val().trim().match(/^([a-zA-Z0-9_\-\.]+)@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.)|(([a-zA-Z0-9\-]+\.)+))([a-zA-Z]{1,5}|[0-9]{1,3})(\]?)$/) == null) {
                return false;
            }
        }
		if($(input).attr('name') == 'cust_phone') {
            if($(input).val().trim().match(/^\d{10}$/) == null) {
                return false;
            }
        }
        else {
            if($(input).val().trim() == ''){
                return false;
            }
        }
    }

    function showValidate(input) {
        var thisAlert = $(input).parent();

        $(thisAlert).addClass('alert-validate');
		$(thisAlert).addClass('red-border');
        //$(thisAlert).append('<span class="btn-hide-validate">&#xf136;</span>')
        $('.btn-hide-validate').each(function(){
            $(this).on('click',function(){
               hideValidate(this);
            });
        });
		$("#create_quote_btn").attr("disabled","disabled");
    }

    function hideValidate(input) {
        var thisAlert = $(input).parent();
        $(thisAlert).removeClass('alert-validate');
		$(thisAlert).removeClass('red-border');
        $(thisAlert).find('.btn-hide-validate').remove();
		$("#create_quote_btn").removeAttr("disabled");
    }
})(jQuery);
/*********************************************  JQuery For Form Submit  ************************************/
$("#quoteForm").submit(function(e) {
	e.preventDefault();
	var form = $(this);
	$("#registration-loader").show();
	$.ajax({
		 type: "POST",
		 url: 'ajax.php?action=SUBMIT_QUOTE',
		 data: form.serialize(),
		 success: function(html) {
			var data=html.trim();
			if(data=="SUCCESS")
			{
				$("#registration-loader").hide();
				window.location.href="quote-compare.php";  
			}
			else
			{
				console.log("Database error occur");
				$("#registration-loader").hide();
			}
		 }
	});
});